import React from 'react';
import Header from './Header';
import Footer from '../components/layouts/Footer';
// import { Navbar, Nav } from "react-bootstrap";
// import Footer from './Footer';

const Home = () => {
    return (
        <>
            <Header />


            <div class="container-fluid">
                <img src="" alt="" />
            </div>


            <Footer />
        </>
    )
}

export default Home
